		<description><![CDATA[1줄 요약 牟鈺丹(성씨 모, 보화 옥, 모란/정성스러울 란) 1999년 5월 25일 &#8230;중략&#8230; 른 특징으로는 동공, 피부, 체모, 치아, 골격, 식생활, 체육능력 .. 牟鈺丹(성씨 모, 보화 옥, 모란/정성스러울 란) 1999년 5월 25일 출생, 1남1녀 중 장녀. 다른 이름 후보로는 예원, 자련, 란새 등이 있었어요. 란이가 사는 세계는 수인이 존재하지만 거의 모든 사람들은 그 존재를 모른다는 설정이에요. [&#8230;]]]></description>
